import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  display: inline-block;
  margin-right: 10px;
  width: 20px;
  height: 20px;
  border: 1px solid ${props => props.active ? '#2196F3' : '#9ABBCE'};
  border-radius: 2px;
`;
